import React from 'react'
import JuiceBody from "../components/JuiceBody";
import Navbar from "../components/Navbar";
import Cart from "../components/Cart";

const Juicespage = ({ cart, setCart, juices, setJuices, juice, setJuice}) => {
    return(
        <div>
            <Navbar />
            <JuiceBody cart={cart} setCart={setCart} juices={juices} setJuices={setJuices} juice={juice} setJuice={setJuice} />
        </div>
    )
}
export default Juicespage
